A Christmas concert with a difference, as carols, Christmas anthems and the odd pop
classic are performed with a gospel and soul twist.

Warm yourself on a winters night with gospel, soul, reggae, ska and soca versions of
classics such as Silent Night, Hark the Herald Angels Sing, Jingle Bells, God Rest Ye Merry
Gentlemen and many more.

Filmed at the Porchester Hall in west London, it features UK soul diva Beverley Knight, the
multi- talented jazz blues soul singer Carleen Anderson, Lagos-born jazz soul singer Ola
Onabule and Birmingham~born Bryn Christopher in a unique celebration of Christmas.

Special guests include the legendary original Southern Blues-singing Golden Gate Quartet,
a truly radical jubilee quartet, bringing the swing and groove of jazz into gospel music.
Formed in the 1930s, the group still feature two original members. MD Ken Burton leads a
stellar choir featuring a range of other top vocalists, all backed by a sizzling soul band...

